webpackJsonp([0xc8df68ec3655],{3530:function(t,e){t.exports={data:{markdownRemark:{html:"<p>実はこのサイト、ブラウザごとに最適なHTMLを用意してるんですよ。たとえば……Lynx用、DreamPassport2用、iMODE(MONO・256color)用、EZweb(cdmaOne、TU-KA)用、Netscape2-5用、Internet Explorer3-5用、ほかそれ以外のブラウザにも対応できるようにHTML2.0完全準拠の予備HTMLを1つ。またそれらの日本語版と英語版を用意。ですから1つHTMLコンテンツを作るのに24のHTMLを用意する必要がありますので更新は結構カメの歩みです。ご了承下さい。(潔癖症とか言われたらそれまでですが……)  今後は1つの街が出来る予定です。(現時点では鍵のかかった1棟の小屋だけですが……)ぼっと(NPC)は20人程置きます。そして2年以内に移転・自前サーバにて運用します。(20人もぼっとがいたら負荷だってたまらないでしょ)</p>",frontmatter:{cover:null,date:"2000-07-02T19:44:16+09:00",strDate:"2000/7/2",title:"余談"}}},pathContext:{path:"/ja/blog/2000/07/02-html/",langKey:"ja"}}}});
